import React from 'react';
import {Container, Wrapper, Header, H1, SmallContainer, ParallaxBackground} from '../components'

import ironManPoster from '../assets/ironManPoster.jpg'

import Card from './Card'
import {MoviesList} from '../data/MoviesList.js'


class WatchOrder extends React.Component {

	render() {
		console.log(MoviesList);

		const newArray = MoviesList.filter(user => user.name.toLowerCase().includes(('iron').toLowerCase()));

		console.log(newArray);

		const cardsArray = newArray.map((currentValue, i) => {
			return <Card movieName={newArray[i].movieName} releaseDate={newArray[i].releaseDate}/>
		});

		console.log(cardsArray );

		return(

		    <Wrapper>
			    <Header>
			    	<H1 big>MCU WATCH ORDER</H1>
			    	<br/><br/>
			    </Header>

			    <Container>
			    	{cardsArray}
			    </Container>
		    </Wrapper>
		);
	}

}

export default WatchOrder;
